import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Home from '../pages/Home';
import Shop from '../pages/Shop';
import Blog from '../pages/Blog';
import BlogSingle from '../pages/BlogSingle';
import SingleProduct from '../pages/SingleProduct';
import About from '../pages/About';
import Contact from '../pages/Contact';
import Wishlist from '../pages/Wishlist';
import Cart from '../pages/Cart';
import Checkout from '../pages/Checkout';
import Thanks from '../pages/Thanks';
import Login from '../pages/Login';
import Profile from '../pages/Profile';
import Admin from '../pages/AdminPanel';
import Brandlist from '../actions/Brandlist';
import AddBrand from '../actions/AddBrand';
import EditBrand from '../actions/EditBrand';

// Вспомогательная функция для проверки авторизации
const isAuthenticated = () => {
    const token = localStorage.getItem('token');
    // Ваша логика проверки токена
    return token !== null; // Возвращаем true, если токен есть, иначе false
}

// Приватный маршрут, который требует авторизации
const PrivateRoute = ({ element, path }) => {
    return isAuthenticated() ? element : <Navigate to="/login" />;
}

// Публичный маршрут, который должен быть доступен только для неавторизованных пользователей
const PublicRoute = ({ element, path }) => {
    return isAuthenticated() ? <Navigate to="/profile" /> : element;
}

export default function Content() {
    return (
        <main className="flex-shrink-0">
            <Router>
                <Routes>
                    <Route path="/" element={<Home />} />

                    <Route path="/shop-left-sidebar" element={<Shop />} />
                    <Route path="/single-product/:id" element={<SingleProduct />} />

                    <Route path="/blog-single/:id" element={<BlogSingle />} />
                    <Route path="/blog-list" element={<Blog />} />

                    <Route path="/about" element={<About />} />

                    <Route path="/contact" element={<Contact />} />

                    <Route path="/wishlist" element={<Wishlist />} />
                    <Route path="/cart" element={<Cart />} />

                    <Route path="/checkout" element={<Checkout />} />
                    <Route path="/thanks" element={<Thanks />} />

                    <PublicRoute path="/login" element={<Login />} />
                    <PrivateRoute path="/profile" element={<Profile />} />

                    <PrivateRoute path="/admin" element={<Admin />} />

                    <PrivateRoute path="/admin/brands" element={<Brandlist />} />
                    <PrivateRoute path="/admin/brands/add" element={<AddBrand />} />
                    <PrivateRoute path="/admin/brands/edit/:id" element={<EditBrand />} />
                </Routes>
            </Router>
        </main>
    );
}
